import React from "react";
import { useParams } from "react-router-dom";

import { Error } from "../../molecules";
import { ProfesionalRegister } from "../../organisms";
import { BasicLayout } from "../../layout";
import { useFetch, FETCHSTATES } from "../../../hooks";

import "./index.scss";

export const MyServices = () => {
  const params = useParams();

  const [serviceRequest, serviceRequestStatus, serviceRequestError] = useFetch(
    `services/${params.serviceId}`
  );

  if (!params.serviceId)
    return <Error title="No has especificado un servicio para ver!" />;

  return (
    <BasicLayout>
      <div id="my-services">
        {serviceRequestStatus !== FETCHSTATES.loading &&
        !serviceRequestError ? (
          <ProfesionalRegister service={serviceRequest.service} />
        ) : (
          <Error title="No has especificado un servicio para ver!" />
        )}
      </div>
    </BasicLayout>
  );
};
